import React from 'react';
import BookingSub1 from './BookingSub1';
import BookingSub2 from './BookingSub2';
import BookingSub3 from './BookingSub3';

function Booking() {
    return(
        <>
            <BookingSub1></BookingSub1>
            <BookingSub2></BookingSub2>
            <BookingSub3></BookingSub3>
        </>
    )
}

export default Booking;
